import React from "react";

import { useParams } from "react-router-dom";

export default function BlogPage(){
    const {blogId } = useParams();

    console.log(blogId);

    function printHI () {
        console.log("HI");
    }

    function printThere() {
        setTimeout(() => {
            console.log("there");
        }, 500);
    }

    function printIX () {
        console.log("iX");
    }

    printHI();
    printThere();
    printIX();

    return <div>Build Blog Page</div>
}
